struct miner_result{
    uint8_t digset[32];
    uint8_t result[32];
};

bool sha3_512(uint8_t *dest,int dlen,uint8_t *data,int len) {
	if (dest == 0 || dlen != 64 || data == 0 || len < 0) {
		return false;
	} 
	sha3(data,len,dest,dlen);
	return true;
}
int genLookupTable(uint64_t *plookup,int plen, uint32_t *ptable,int tlen) {
    if (plookup == 0 || plen < 10240*32 || ptable == 0 || tlen < TBLSIZE*DATALENGTH*PMTSIZE) {
        return 0;
    }
	uint32_t lktWz = (uint32_t)(DATALENGTH / 64);
	uint32_t lktSz = (uint32_t)(DATALENGTH) * lktWz;

	//idx := 0
	for (int k = 0; k < TBLSIZE; k++) {

		uint32_t plkt = (uint32_t)k * lktSz;

		for (int x = 0; x < DATALENGTH; x++) {

			for (int y = 0; y < PMTSIZE; y++) {
				uint32_t val = ptable[k*DATALENGTH*PMTSIZE+x*PMTSIZE+y];
				if (val == 0xFFF) {
					continue;
				}
				uint32_t vI = val / 64;
				uint32_t vR = val % 64;
				plookup[plkt+vI] |= (uint64_t)1 << vR;
			}
			plkt += lktWz;
		}
	}
	return 0;
}

int xor64(uint64_t val) {
	int r  = 0;
	for (int k = 0; k < 64; k++) {
		r ^= (int)(val & 0x1);
		val = val >> 1;
	}
	return r;
}

uint32_t muliple(uint64_t* input,int inputlen,uint64_t* prow,int prowlen) {
	int r = 0;
    if (inputlen < 32 || prowlen < 32) {
        return 0;
    }
	for (int k = 0; k < 32; k++) {
		if (input[k] != 0 && prow[k] != 0) {
			r ^= xor64(input[k] & prow[k]);
		}
	}

	return (uint32_t)r;
}
int MatMuliple(uint64_t* input,int inputlen,uint64_t* output,int outlen,uint64_t* pmat,int pmatlen) {
    uint32_t point = 0;
    if (input == 0 || inputlen<2048 || output==0 || outlen < 32 || pmat == 0 || pmatlen < 32*2048) {
        return 0;
    }
    for (int k=0;k<2048;k++) {
        int kI = k / 64;
        int kR = k % 64;
        uint32_t temp = muliple(input,inputlen,pmat+point,pmatlen-point);
        output[kI] |= (uint64_t)temp << kR;
        point += 32;
    }
    return 0;
}
int shift2048(uint64_t *in, int inlen, int sf) {
    if (in == 0 || inlen < 32) {
        return 0;
    }
	int sfI = sf / 64;
	int sfR = sf % 64;
	uint64_t mask = (uint64_t)(1) << sfR - 1;
	int bits = (64 - sfR);
	uint64_t res = 0;
	if (sfI == 1) {
		uint64_t val = in[0];
		for (int k = 0; k < 31; k++) {
			in[k] = in[k+1];
		}
		in[31] = val;
	}
	res = (in[0] & mask) << (bits);
	for (int k = 0; k < 31; k++) {
		uint64_t val = (in[k+1] & mask) << (bits);
		in[k] = (in[k] >> (sfR)) + val;
	}
	in[31] = (in[31] >> (sfR)) + res;
	return 0;
}
int scramble(uint64_t *permute_in,int inlen, uint64_t *plookup, int plen)  {
    if (permute_in == 0 || inlen < 64 || plookup == 0 || plen < 10240) {
        return 0;
    }
	uint64_t *ptbl = 0;
    uint64_t permute_out[32] = {0};

	for (int k = 0; k < 64; k++) {

		int sf = (int)(permute_in[0] & 0x7f);
		int bs = (int)(permute_in[31] >> 60);
        int pos = bs*2048*32;
		ptbl = plookup + pos;

		MatMuliple(permute_in,inlen, permute_out,32, ptbl,plen-pos);
		shift2048(permute_out,32, sf);

		for (int i = 0; i < 32; i++) {
			permute_in[i] = permute_out[i];
			permute_out[i] = 0;
		}
	}
	return 0;
}
int byteReverse(uint8_t *sha512_out,int len)  {
    if (sha512_out == 0 || len < 64) {
        return 0;
    }
	for (int k = 0; k < 32; k++) {
		uint8_t temp = sha512_out[k];
		sha512_out[k] = sha512_out[63-k];
		sha512_out[63-k] = temp;
	}
	return 0;
}

void fchainmining(uint64_t *plookup,int plen, uint8_t header[HEADSIZE],uint64_t nonce,struct miner_result *res) {
	uint8_t seed[64] = {0};
    if (plookup == 0 || plen < 10240*32 || res == 0) {
        res = 0;
        return ;
    }
    uint8_t *output = (uint8_t*)calloc(DGSTSIZE,1);
	uint32_t val0 = (uint32_t)(nonce & 0xFFFFFFFF);
	uint32_t val1 = (uint32_t)(nonce >> 32);

	for (int k = 3; k >= 0; k--) {
		seed[k] = (uint8_t)val0 & 0xFF;
		val0 >>= 8;
	}
	for (int k = 7; k >= 4; k--) {
		seed[k] = (uint8_t)val1 & 0xFF;
		val1 >>= 8;
	}
    uint8_t *dgst = (uint8_t*)calloc(DGSTSIZE,1);

	for (int k = 0; k < HEADSIZE; k++) {
		seed[k+8] = header[k];
	}
    uint8_t sha512_out [64] = {0};
    uint64_t permute_in [32] = {0};

	sha3_512(sha512_out,64,seed,64);
	byteReverse(sha512_out,64);
	
	for (int k = 0; k < 8; k++) {
		for (int x = 0; x < 8; x++) {
			int sft = x * 8;
			uint64_t val = (uint64_t)(sha512_out[k*8+x]) << sft;
			permute_in[k] += val;
		}
	}
	for (int k = 1; k < 4; k++) {
		for (int x = 0; x < 8; x++) {
			permute_in[k*8+x] = permute_in[x];
		}
	}

	scramble(permute_in,32, plookup,plen);

	uint8_t dat_in [256] = {0};
	for (int k = 0; k < 32; k++) {
		uint64_t val = permute_in[k];
		for (int x = 0; x < 8; x++) {
			dat_in[k*8+x] = (uint8_t)(val & 0xFF);
			val = val >> 8;
		}
	}

	for (int k = 0; k < 64; k++) {
		uint8_t temp = 0;
		temp = dat_in[k*4];
		dat_in[k*4] = dat_in[k*4+3];
		dat_in[k*4+3] = temp;
		temp = dat_in[k*4+1];
		dat_in[k*4+1] = dat_in[k*4+2];
		dat_in[k*4+2] = temp;
	}

	sha3_512(output,64,dat_in,256);
	// reverse byte
	for (int k = 0; k < DGSTSIZE; k++) {
		dgst[k] = output[k];
	}
    memcpy(res->digset,dgst,32);
    memcpy(res->result,dgst,32);
	return;
}

